import React, { Component } from "react";
import Header from "./Components/Header";
import Members from "./Components/Members";
import Teams from "./Teams";

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      members: Teams.all,
    };

    this.select = (path) => {
      switch (path) {
        case "pwn":
          this.setState({ members: Teams.pwn });
          break;

        case "web":
          this.setState({ members: Teams.web });
          break;

        case "reversing":
          this.setState({ members: Teams.reversing });
          break;

        case "crypto":
          this.setState({ members: Teams.crypto });
          break;
      }
    };
  }

  render() {
    return (
      <div className="App">
        <Header></Header>
        <Members members={this.state.members}></Members>
      </div>
    );
  }
}

export default App;
